    A[6] = -0.0408192791005271*G0_0_0 - 0.0408192791005275*G0_0_1 - 0.0408192791005273*G0_1_0 - 0.0408192791005274*G0_1_1;
    A[7] = 0.0408192791005271*G0_0_0 + 0.202374063051145*G0_0_1 + 0.0408192791005274*G0_1_0 + 0.202374063051145*G0_1_1;
    A[8] = -0.0696683476631382*G0_0_0 - 0.449959352954143*G0_0_1 - 0.0696683476631385*G0_1_0 - 0.449959352954144*G0_1_1;
    A[9] = -0.015845458553792*G0_0_0 + 0.594204695767194*G0_0_1 - 0.0158454585537922*G0_1_0 + 0.594204695767194*G0_1_1;
    A[10] = 0.20228794642857*G0_0_0 - 0.648027584876541*G0_0_1 + 0.20228794642857*G0_1_0 - 0.648027584876541*G0_1_1;
